import React from 'react';
import './card.css';
// import { Link } from 'react-router-dom';
const Card = () => {
  const nfts = [
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 1" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 1" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 2" },
  ];

  const nfts1 = [
    { src: `${process.env.PUBLIC_URL}/images/g1.png`, title: "NFT 1" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g3.png`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g1.png`, title: "NFT 1" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g3.png`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
  ];

  return (
<>
<div className="container">
      <div className="row">
     <div className="col-sm-3">
      <div class="card" >
      <img className='img2' height={50} src={ `${process.env.PUBLIC_URL}/images/a19.png`} class="card-img-top" alt="..."/>
        <img className='img1' src={ `${process.env.PUBLIC_URL}/images/g4.jpeg`} class="card-img-top"
        
        
        
        alt="..."/>
        <img className='img3' src={ `${process.env.PUBLIC_URL}/images/a20.png`} class="card-img-top" alt="..."/>

      </div>
          </div>
      </div>
    </div>
    </>
  );
};

export default Card;
